    render() {
       

        return (
            <div style={{display:"flex", flexDirection:"row", justifycontent:"space-between"}}>
                <div style={{display:"flex", flexDirection:"column", justifycontent:"center", width:"20vw", height:"100vh"}}>
                    <h2>Legato</h2>
                    <div style={{display:"flex", flexDirection:"column", justifycontent:"center"}}>profile</div>
